import React from "react";
import { useAuth } from "../context/AuthContext";
import { signOut } from "firebase/auth";
import { useNavigate } from "react-router-dom";
import Sidebar from "./sidebar.component"; 
import UserProfile from "./userprofile.widget";
import UserList from "./userList";
import WeatherWidget from "./weather.widget";
import Stocks from "./stock.widget";
import Quotes from "./quotes.widget";
import Calculator from "./Calculator";
import Checklist from "./Checklist";
import { auth } from "../firebase/firebase";
import "../styles/dashboard.css";

const Dashboard = () => {
    const { currentUser } = useAuth();
    const navigate = useNavigate();

    const handleLogout = async () => {
        try {
            await signOut(auth);
            navigate("/");
        } catch (error) {
            console.error("Error signing out: ", error);
        }
    };

    return (
        <div className="dashboard">
            <Sidebar handleLogout={handleLogout} />
            <div className="widgets">
                {/* Full width User Profile */}
                <UserProfile className="full-width-widget" />

                {/* Weather, Quotes, and Calculator in one row */}
                <WeatherWidget className="row-widget" />
                <Quotes className="row-widget" />
                <Calculator className="row-widget" />
                </div>
                <div>
                {/* Full width Stocks and Checklist */}
                <Stocks className="full-width-widget" />
                <Checklist className="full-width-widget" />
            </div>
        </div>
    );
};

export default Dashboard;
